import React, {ChangeEvent, useState} from 'react';
import  s from "./MaxValue.module.css"


type MaxMInValueType = {
set:(Max:number,Min:number)=>void
    MaxValue:(e:number)=>void
    MinValue:(e:number)=>void
}




export const MaxMInValue = (props: MaxMInValueType) => {


    const [Max,SetMAx]=useState(0)
    const [Min,SetMin]=useState(0)


    const MaxValue = (e: ChangeEvent<HTMLInputElement>) => {
        SetMAx(+e.currentTarget.value)
        props.MaxValue(+e.currentTarget.value)

    }
    const MinValue = (e: ChangeEvent<HTMLInputElement>) => {
        SetMin(+e.currentTarget.value)
        props.MinValue(+e.currentTarget.value)
    }

    const onClick =()=> {
   props.set(Max,Min)
    }

    return (
        <div className={s.around_wrapper}>
            <div>Max Value: <input onChange={MaxValue} type='number' className={Min>=Max ? s.error_Score: ''}/></div>
            <div>Min Value: <input  onChange={MinValue} type='number' className={Min>=Max ? s.error_Score: ''}/></div>
            <button disabled={Min>=Max} onClick={onClick}>set</button>
        </div>
    );
};
